import React from 'react';
import './registerpage.css';

const Register = () => {
    return (
        <div>
            <h3>Register your account</h3>
            <div>
                <h5>Your username</h5>
                <input type='text' placeholder='Doe'></input>
            </div>
            <div>
                <h5>Your email</h5>
                <input type='text' placeholder='xxx@mailbox.com'></input>
            </div>
            <div>
                
            </div>
        </div>
    )
}

export default Register;
